records.addlTxt:
Defendant Jermain Johnson in court with attorney Gary Edward Rosenthal.  Jessica Bellows appeared for the State of Wisconsin.  Deputy Court Clerk: KAR.
Case calendared for sentencing hearing.  Negotiations placed on the record by the state.  Sentencing proceeded.  Statements by the state, defense and defendant.  Defense requests expungement and state takes no position.  Court denied defense request for expungement.

AS TO COUNT 1: The Court ordered defendant to serve 45 days in the House of Correction, consecutive to any other sentence, with credit for 3 days time served.  The Court granted Huber privileges, pursuant to 303.08 Wis. Stats. for work and school.  Court STAYED the sentence to 5/5/16 at 5:00 pm.

Court ordered defendant to pay all mandatory costs, fees and surcharges, cash bail to apply.  Court ordered a payment plan in the amount of $50.00 per month with the first payment due on 7/1/16 and additional payments due the 1ST of each month thereafter.  If there are any missed payments, any remaining balance will be due FORTHWITH and an immediate entry of a civil judgment is ordered by the Court.

Court ordered defendant to submit a DNA sample and pay the DNA surcharge.  Court ordered restitution set at $0.

Defendant advised of appeal rights.

Filed;
